false&amp;lang=en&amp;modules=html5shiv&amp;only=scripts&amp;skin=vector&amp;sync=1"></script><![endif]--> </head> <body class="mediawiki ltr sitedir-ltr mw-hide-empty-elt ns-0 ns-subject page-Test rootpage-Test skin-vector action-view">		<div id="mw-page-base" class="noprint"></div> 		<div id="mw-head-base" class="noprint"></div> 		<div id="content" class="mw-body" role="main"> 			<a id="top"></a> 			<div id="siteNotice" class="mw-body-content"><!-- CentralNotice --></div><div class="mw-indicators mw-body-content"> <div id="mw-indicator-pp-default" class="mw-indicator"><a href="/wiki/Wikipedia:Protection_policy#semi" title="This article is semi-protected due to vandalism"><img alt="Page semi-protected" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Padlock-silver.svg/20px-Padlock-silver.svg.png" width="20" height="20" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Padlock-silver.svg/30px-Padlock-silver.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Padlock-silver.svg/40px-Padlock-silver.svg.png 2x" data-file-width="128" data-file-height="128" /></a></div> </div> <h1 id="firstHeading" class="firstHeading" lang="en">Test</h1>			<div id="bodyContent" class="mw-body-content"> 				<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>				<div id="contentSub"></div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><div role="note" class="hatnote navigation-not-searchable"><span class="plainlinks selfreference noprint">To make test edits on Wikipedia, please use the <a href="/wiki/Wikipedia:Sandbox" title="Wikipedia:Sandbox">sandbox</a>.</span></div> <table role="presentation" class="mbox-small plainlinks sistersitebox" style="background-color:#f9f9f9;border:1px solid #aaa;color:#000"> <tr> <td class="mbox-image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/40px-Wiktionary-logo-en-v2.svg.png" width="40" height="40" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/60px-Wiktionary-logo-en-v2.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/80px-Wiktionary-logo-en-v2.svg.png 2x" data-file-width="391" data-file-height="391" /></td> <td class="mbox-text plainlist">Look up <i><b><a href="https://en.wiktionary.org/wiki/TEST" class="extiw" title="wiktionary:TEST">TEST</a></b></i>, <i><b><a href="https://en.wiktionary.org/wiki/Test" class="extiw" title="wiktionary:Test">Test</a></b></i>, <i><b><a href="https://en.wiktionary.org/wiki/Tests" class="extiw" title="wiktionary:Tests">Tests</a></b></i>, <i><b><a href="https://en.wiktionary.org/wiki/testing" class="extiw" title="wiktionary:testing">testing</a></b></i>, or <i><b><a href="https://en.wiktionary.org/wiki/tests" class="extiw" title="wiktionary:tests">tests</a></b></i> in Wiktionary, the free dictionary.</td> </tr> </table> <p><b>Test</b>, <b>TEST</b> or <b>Tester</b> may refer to:</p> <ul> <li><a href="/wiki/Test_(assessment)" title="Test (assessment)">Test (assessment)</a>, an assessment intended to measure the respondents' knowledge or other abilities</li> <li><a href="/wiki/Medical_test" title="Medical test">Medical test</a>, to detect, diagnose, or monitor diseases</li> </ul> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Science_and_technology"><span class="tocnumber">1</span> <span class="toctext">Science and technology</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Arts_and_media"><span class="tocnumber">2</span> <span class="toctext">Arts and media</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#People"><span class="tocnumber">3</span> <span class="toctext">People</span></a></li> <li class="toclevel-1 tocsection-4"><a href="#Other_uses"><span class="tocnumber">4</span> <span class="toctext">Other uses</span></a></li> <li class="toclevel-1 tocsection-5"><a href="#See_also"><span class="tocnumber">5</span> <span class="toctext">See also</span></a></li> </ul> </div> </div> <h2><span class="mw-headline" id="Science_and_technology">Science and technology</span></h2> <ul> <li><a href="/wiki/Test_(Unix)" title="Test (Unix)">test (Unix)</a>, a Unix command for evaluating conditional expressions</li> <li><a href="/wiki/TEST_(x86_instruction)" title="TEST (x86 instruction)">TEST (x86 instruction)</a>, an x86 assembly language instruction</li> <li><a href="/wiki/Experiment" title="Experiment">Experiment</a>, a part of the scientific method</li> <li><a href="/wiki/Test_(biology)" title="Test (biology)">Test (biology)</a>, the shell of sea urchins and certain microorganisms</li> <li><a href="/wiki/Test_method" title="Test method">Test method</a>, a definitive procedure that produces a test result</li> <li><a href="/wiki/Chemical_test" title="Chemical test">Chemical test</a>, a procedure designed to prove the existence of, or to quantify, a particular substance</li> <li><a href="/wiki/Medical_test" title="Medical test">Medical test</a>, to detect, diagnose, or monitor diseases</li> <li><a href="/wiki/Physical_test" title="Physical test">Physical test</a>, a method for determining characteristics of a product</li> <li><a href="/wiki/Psychological_testing" title="Psychological testing">Psychological testing</a>, the use of behavioral samples to make inferences about an individual</li> <li><a href="/wiki/Software_testing" title="Software testing">Software testing</a>, the process of verifying that a software program works as expected</li> <li><a href="/wiki/Statistical_hypothesis_testing" title="Statistical hypothesis testing">Statistical hypothesis testing</a>, a method of making statistical decisions using experimental data, particular case of the former</li> <li><a href="/wiki/Toxicology_testing" title="Toxicology testing">Toxicology testing</a>, to determine the degree to which a substance can damage organisms</li> </ul> <h2><span class="mw-headline" id="Arts_and_media">Arts and media</span></h2> <ul> <li><a href="/wiki/Test_(film)" title="Test (film)"><i>Test</i> (film)</a>, a 2013 American film</li> <li><a href="/wiki/Test_(group)" title="Test (group)">Test (group)</a>, a jazz collective</li> <li><a href="/wiki/Tests_(album)" title="Tests (album)"><i>Tests</i> (album)</a>, a 1998 album by The Microphones</li> <li><i><a href="/wiki/Johnny_Test" title="Johnny Test">Johnny Test</a></i>, an American/Canadian animated television series</li> <li>"Tester" a song by Anthrax on the album <i><a href="/wiki/Stomp_442" title="Stomp 442">Stomp 442</a></i></li> <li><i><a href="/wiki/The_Tester" title="The Tester">The Tester</a></i>, a reality show produced by Sony about videogame testing</li> </ul> <h2><span class="mw-headline" id="People">People</span></h2> <ul> <li><a href="/wiki/Test_(wrestler)" title="Test (wrestler)">Test (wrestler)</a>, ring name for Andrew Martin (1975–2009), Canadian professional wrestler</li> <li><a href="/wiki/John_Test" title="John Test">John Test</a> (1771–1849), American politician</li> <li><a href="/wiki/Zack_Test" title="Zack Test">Zack Test</a> (born 1989), American rugby union player</li> <li><a href="/wiki/Tester_(surname)" title="Tester (surname)">Tester (surname)</a>, shared by several notable people</li> </ul> <h2><span class="mw-headline" id="Other_uses">Other uses</span></h2> <ul> <li><a href="/wiki/River_Test" title="River Test">River Test</a>, a river in England</li> <li>Tester, the upper part of a <a href="/wiki/Four-poster_bed" title="Four-poster bed">four-poster bed</a></li> <li>Tester, a <a href="/wiki/Sounding_board" title="Sounding board">sounding board</a>, a canopy over a tomb or pulpit</li> <li><a href="/wiki/Test_match_(disambiguation)" class="mw-redirect mw-disambig" title="Test match (disambiguation)">Test match (disambiguation)</a>, an international contest in various sports <ul> <li><a href="/wiki/Test_(cricket)" class="mw-redirect" title="Test (cricket)">Test (cricket)</a>, the highest form of the sport of cricket</li> </ul> </li> <li><a href="/wiki/Legal_tests" title="Legal tests">Legal tests</a>, methods of evaluation used to resolve matters of jurisprudence</li> <li><a href="/wiki/Usability_testing" title="Usability testing">Usability testing</a>, a technique to evaluate a product by testing it on users</li> </ul> <h2><span class="mw-headline" id="See_also">See also</span></h2> <table role="presentation" class="mbox-small plainlinks sistersitebox selfreference" style="background-color:#f9f9f9;border:1px solid #aaa;color:#000"> <tr> <td class="mbox-image"><a href="/wiki/File:Vector_search_icon.svg" class="image"><img alt="Vector search icon.svg" src="//upload.wikimedia.org/wikipedia/commons/thumb/7/7e/Vector_search_icon.svg/30px-Vector_search_icon.svg.png" width="30" height="33" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/7/7e/Vector_search_icon.svg/45px-Vector_search_icon.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/7/7e/Vector_search_icon.svg/60px-Vector_search_icon.svg.png 2x" data-file-width="12" data-file-height="13" /></a></td> <td class="mbox-text plainlist">Search for <i><b><span class="plainlinks"><a class="external text" href="//en.wikipedia.org/w/index.php?title=Special:Search&amp;search=Test&amp;ns0=1&amp;fulltext=Search">Test</a></span></b></i> on Wikipedia.</td> </tr> </table> <ul> <li><a href="/wiki/List_of_tests" title="List of tests">List of tests</a></li> <li><a href="/wiki/The_Test_(disambiguation)" class="mw-redirect mw-disambig" title="The Test (disambiguation)">The Test (disambiguation)</a></li> <li><span class="selfreference"><a href="/wiki/Special: